```json
{
  "job": {
    "content": [
      {
        "reader": {
          "name": "opentsdbreader",
          "parameter": {
            "endpoint": "http://127.0.0.1:4242",
            "column": [
              "cpu_usage_system",
              "cpu_usage_user"
            ],
            "beginDateTime": "2023-10-26 00:00:00",
            "endDateTime": "2023-10-27 00:00:00"
          }
        },
        "writer": {
