          "parameter": {
            "path": "/home/fedora_38_user/datax",
            "fileName": "result.txt",
            "writeMode": "truncate",
            "dateFormat": "yyyy-MM-dd"
          }
        }
      }
    ],
    "setting": {
      "speed": {
        "channel": 1
      }
    }
  }
}
